import React from 'react';
import { BrowserRouter as Router,Switch ,Route, Routes } from 'react-router-dom';





export function App() { 
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route path='/' exact render={prompt => <Home prompt={prompt} />} /> 
          <Route path='/login' exact render={prompt => <Login prompt={prompt} />} />
          <Route path='/contact' exact render={prompt => <Contact prompt={prompt} />} />
          <Route path='/company' exact render={prompt => <Company prompt={prompt} />} />
          <Route path='/map' exact render={prompt => <MapView prompt={prompt} />} />
          <Route path='/profile' exact render={prompt => <Profile prompt={prompt} />} />
          </Switch>
      </Router>
    </React.Fragment>
  ); 
}
